def create_regionconfiguration(apps, schema_editor):
    RegionConfiguration = apps.get_model('explorers', 'RegionConfiguration')
    RegionConfiguration.objects.bulk_create(
        [RegionConfiguration(**item) for item in region_config_items])


def delete_regionconfiguration(apps, schema_editor):
    RegionConfiguration = apps.get_model('explorers', 'RegionConfiguration')
    RegionConfiguration.objects.filter(
        climatiq_region__in=[item['climatiq_region'] for item in region_config_items]).delete()


def create_regiongeocode(apps, schema_editor):
    RegionGeocode = apps.get_model('explorers', 'RegionGeocode')
    RegionGeocode.objects.bulk_create(
        [RegionGeocode(**item) for item in region_geocode_items])


def delete_regiongeocode(apps, schema_editor):
    RegionGeocode = apps.get_model('explorers', 'RegionGeocode')
    RegionGeocode.objects.filter(
        region__in=[item['region'] for item in region_geocode_items]).delete()


